    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col0 * + + col1 + + col2 NOT IN ( - - col1, - ( - 47 ) );
  - name: tab2

outputs:
  - name: q5574.out
    data: |
      46	51	23
      64	77	40
      75	67	58
